import React from 'react';
import Header from './Header';
import Order from './Order';
import Inventory from './Inventory';

class App extends React.Component {
    state = {
        fishes: {},
        order: {},
    }
    render() {
        return (
            <React.Fragment>
                <div className="catch-of-the-day">
                    <div className="menu">
                        <Header tagLine="Fresh Market New" />
                    </div>
                    <Order />
                    <Inventory></Inventory>
                </div>
            </React.Fragment>
        )
    }

}

export default App;
